import React from 'react';
import {Blog1} from "./../components/Blog1.js"
import {Navbar} from "./../components/Navbar.js"
import { Blog2 } from '../components/Blog2.js';
import { arrayofblogs,arrayofblogs2 } from '../components/arrayofblogs.js';
 function Blog() {
    return(
<>

    <Navbar findnav={' Search Blogs'}/>
    
    <div className='partie1-blob'>
    <Blog1 tableau={arrayofblogs}/>
    </div>
    <div className='partie2-blob'>
    <Blog2 tableau={arrayofblogs2} />
    
   </div>
</>
 )}
export default Blog;
